import React from "react"
import Seat from './Seat'

const SeatAvailability = () => {
	return (
		<div className="row">
			Vazio : <Seat seatColor="seat-grey" />
			Ocupado : <Seat seatColor="seat-red" />
			Selec. : <Seat seatColor="seat-black" />
		</div>
	)
}

export default SeatAvailability
